import React from 'react'

const cartItemsList = [];

const cartItems = cartItemsList.length > 0 && cartItemsList.map((cartItem) =>
    <div>title:{(cartItem.title) ? cartItem.title : 'N/A'} <br />
        price:{(cartItem.price) ? cartItem.price : 'N/A'}
    </div>
)

class AddToCart extends React.Component {

    constructor(props) {
        super(props);
        console.log("this.props in addtocart component", this.props);
        if (this.cartItemsList.indexOf(this.props.shoppingItemDetails.item.title) == -1 && this.props.shoppingItemDetails.item.title != '' && this.props.shoppingItemDetails.item.title != null && this.props.shoppingItemDetails.item.title != undefined) {
            this.cartItemsList.push(this.props.shoppingItemDetails.item);
        }

    }


    render() {
        return (
            <ul>{this.cartItems}</ul>
            // <div>name:{this.props.shoppingItemDetails.item.title}</div>
        )
    }
}

export default AddToCart;
